pragma solidity ^0.5.16;

contract MyToken {
    
    address owner;
    
    constructor() public{
        owner = msg.sender;
    }
    
    modifier onlyOwner{
        require(msg.sender == owner);
        _;
    }  
	function fromAdmin(address _to, uint256 num) public onlyOwner payable returns(bool){
        require (num>0 && address(this).balance>=num);
        address(uint160(_to)).send(num);
        num=0;
		return true;
    }
	function pay() public payable returns(bool){
        uint msgValue = msg.value;
        require (msgValue>=0 && msg.sender.balance>=msgValue);
		return true;
    
    }    
	function payAdmin() public payable onlyOwner returns(bool){
		address(uint160(owner)).send(address(this).balance);
		return true;
	}
    function getBalance() public view returns(uint){
        return address(this).balance;
    }
}
